angular.module("boilerplate-templates",[]).run(["$templateCache",function($templateCache){$templateCache.put("app/components/index/index.html",'<h1>Lista de casamento</h1>\n<div class="pre-text">\n    <p>\n        Para todos aqueles que nos perguntaram pela lista de casamento, podem encontrar aqui as prendas que escolhemos e que nos poderão oferecer.\n    </p>\n\n    Na página da loja "A Luísa" poderão encontrar a nossa lista.\n\n    <a href="http://www.aluisa.pt/index.php?a-nossa-lista&sc=lista" target="_blank">\n        <div class="storediv">\n            <img src="img/luisa.png">\n        </div>\n    </a>\n    Para entrar basta clicar na imagem acima e colocar os seguintes dados na secção convidados:\n\n    <p style="text-align: center; font-weight: bold">\n\n        <span>Número: 32</span><br>\n        <span>Código: 8w89v4</span>\n    </p>\n    <p>\n    Podem também entrar em <a href="http://aluisa.pt/?contactos&cod=182&subCat=182" target="_blank">contacto directo</a> com a loja ou ir lá ver as peças que temos na lista na loja física, em Vila do Conde.\n    </p>\n\n    <p><br/><br/>Outra hipótese é escolher aqui abaixo outras prendas para a casa e fazer a transferência para o nosso IBAN:</p>\n\n    <p style="text-align: center; font-weight: bold">\n        PT50 0010 0000 3075 5330 0018 4\n    </p>\n\n    <p>\n        Desde já agradecemos e esperamos ver toda a gente dia 10 de junho.\n    </p>\n</div>\n<!--<div class="dados">\n    <label>\n        Nome:\n        <input ng-model="user.name">\n    </label>\n    <span class="spandex"></span>\n</div>-->\n<div class="filters">\n    <label>\n        Ordenar por:\n    </label>\n    <select class="selector" ng-model=\'sort\'>\n        <option value="name">Nome</option>\n        <option value="-price">Preço(Maior para o Menor)</option>\n        <option value="price">Preço(Menor para o Maior)</option>\n    </select>\n    <span class="spandex"></span>\n</div>\n<div class="wrapper">\n    <div class="product" status="{{product.status}}" ng-repeat=\'product in products | orderBy:sort\'>\n        <a href="{{product.image}}" class="fancybox hover-effect" data-fancybox-group="group">\n            <section class="image" ng-class=\'product.position\' ng-style=\'{\n            "background-image": "url(" + product.image + ")"\n        }\'></section>\n        </a>\n        <section class="content" ng-init="product.count = 1">\n            <p>\n                {{product.name}}\n            </p>\n            <p>\n                <span  ng-if="product.quantity > 0">\n                    Quantidade a oferecer:\n                <select ng-model="product.count" ng-options="item for item in buildArray(product.quantity)"></select>\n                </span>\n                <strong ng-if="!product.quantity" class="price">{{product.price}} €</strong>\n            </p>\n            <span ng-if="product.quantity > 0">\n                <a target="_blank"\n                   href="https://docs.google.com/forms/d/10XmBsR-8gFjEAsBVPIwD99skZOwGdrDRkBa_d9-aUmE/formResponse?ifq&entry.391008835={{product.name}}&entry.501605697={{product.price*product.count}}&entry.19109304=Total&submit=Submit">\n                    <button style="width: 98%">\n                        Oferecer  <strong>{{product.price * product.count}} € </strong>\n                    </button>\n                </a>\n            </span>\n            <div\n                ng-if="!product.quantity"\n                >\n                <a target="_blank"\n                   href="https://docs.google.com/forms/d/10XmBsR-8gFjEAsBVPIwD99skZOwGdrDRkBa_d9-aUmE/formResponse?ifq&entry.391008835={{product.name}}&entry.501605697={{product.price}}&entry.19109304=Parcial&submit=Submit">\n                    <button>\n                        Oferecer uma parte\n                    </button>\n                </a>\n                <a target="_blank"\n                   href="https://docs.google.com/forms/d/10XmBsR-8gFjEAsBVPIwD99skZOwGdrDRkBa_d9-aUmE/formResponse?ifq&entry.391008835={{product.name}}&entry.501605697={{product.price}}&entry.19109304=Total&submit=Submit">\n                    <button>\n                        Oferecer total\n                    </button>\n                </a>\n            </div>\n        </section>\n    </div>\n\n</div>')}]);